import styled from 'styled-components';

const SlagalicaButton = styled.button`
  background-color: #4fc3f7;
  color: black;
  font-size: 15px;
  padding: 4px 17px;
  border-radius: 5px;
  margin: 10px 0px;
  cursor: pointer;
`;

export default SlagalicaButton;
